import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{r as d,o as t,c,a as l,d as i,b as n,e as o}from"./app-1c5b5ce3.js";const r={},s=o('<p>分享一篇网友在面试网易时候的面经，包括一二三面，Java后端春招实习，给大家感受下一二三面的侧重点。</p><ul><li>第一面专注在项目</li><li>第二面专注在网络、MySQL、操作系统、Linux命令八股文</li><li>第三面专注在JVM、线程池、分布式锁、设计模式、Linux命令八股文</li></ul><h2 id="网易一面" tabindex="-1"><a class="header-anchor" href="#网易一面" aria-hidden="true">#</a> 网易一面</h2><ul><li>介绍一下你自己</li><li>介绍一下你的项目</li><li>在这个项目中遇到了哪些难点</li><li>给我介绍一下MQTT协议</li><li>项目聊了20分钟。。。</li><li>讲一下Redis的持久化机制</li></ul><blockquote><p>算法</p></blockquote><ul><li>数组中重复的数字。</li><li>二叉树的中序遍历，不用递归。</li></ul><blockquote><p>总结</p></blockquote><p>一面主要聊项目，就问了一个八股问题。</p><p>Morris遍历可以了解一下，我中序遍历用的Morris遍历，面试官眼前一亮。</p><p>可能一面八股问的比较少，接下来的二面整整问了我50分钟八股，剩下的一句没问。。。</p><h2 id="网易二面" tabindex="-1"><a class="header-anchor" href="#网易二面" aria-hidden="true">#</a> 网易二面</h2><ul><li>假如说我在数据库读取出来的数据乱码了怎么办</li><li>你的数据库一般使用什么编码格式</li><li>如果数据库编码格式没有问题，但是你的程序读出来还是乱码怎么办</li><li>介绍一下MySQL事务的ACID</li><li>你讲一下MySQL数据库的隔离级别？</li><li>MySQL默认的隔离级别是什么</li><li>可重复读是怎么解决脏读和不可重复读问题的？</li><li>MVCC是如何解决脏读和不可重复读问题的呢？</li><li>MVCC是如何与ReadView的属性进行比较的?</li><li>你知道哪些索引</li><li>用过MySQL索引吗</li><li>你一般是怎么建索引的</li><li>比如说有一个语句是where x=a and y=b and z=c,你怎么建索引</li><li>那比如说再来一个wherey=a and z=b呢,你怎么建索引</li><li>那么第一个条件where x=a and y=b and z=c会用到哪些索引</li><li>那比如说有一个语句是where y=a and z between b and c,你怎么建索引</li><li>那么where y=a and z between b and c and x=d会用到哪些索引</li><li>熟悉http吗</li><li>听说过http的缓存吗，介绍一下</li><li>哪个字段控制缓存策略</li><li>知道http哪些方法</li><li>put和post什么区别？它们功能差别很大吗？</li><li>了解过Http的一些规范吗，比如restful？</li><li>一般你做的项目是前后端分离的吗？那你们是先写文档还是先编码</li><li>熟悉Docker吗？编写过Docker file吗</li><li>说一下进程的创建过程</li><li>进程号和PCB什么关系</li><li>说一下进程的调度过程</li><li>进程调度的算法</li><li>说一下FCFS的缺点</li><li>说一下时间片轮转的缺点</li><li>时间片大小是怎么确定的</li><li>现代计算机一般用的什么调度算法</li><li>说一下多级反馈队列算法</li><li>每个优先级队列使用的是什么调度策略</li><li>多级反馈队列支持优先级调度吗</li><li>进程间通信的方式</li><li>管道分为哪些</li><li>用的比较多的通信方式有哪几种</li><li>文件能用来作为进程间通信的方式吗</li><li>linux了解哪些</li><li>假如说你运行了一个java程序，端口号为10000，你怎么查看</li><li>除了netstat这种方式你还会用别的方式吗</li><li>假如说你现在找到了这个java程序，你怎么关闭掉他</li><li>如果kill不掉呢</li><li>如何优雅的关闭或者程序</li></ul><blockquote><p>面试总结</p></blockquote><p>整整50分钟八股，有点绷不住了。。</p><h2 id="网易三面" tabindex="-1"><a class="header-anchor" href="#网易三面" aria-hidden="true">#</a> 网易三面</h2><ul><li>谈谈JVM虚拟机</li><li>JVM虚拟机是有哪些部分组成的</li><li>JVM虚拟机的内存结构</li><li>方法区存放哪些信息</li><li>常量存放在哪个区域</li><li>一般用什么方法来创建一个线程池</li><li>线程池有哪些比较关键的参数</li><li>线程池的核心线程数一般怎么设置</li><li>为什么讲核心线程数设置为CPU核数*2</li><li>什么情况下任务会进入到等待队列当中</li><li>线程有哪些状态，用白板画一下，包括一个状态转移到另一个状态可以使用哪些方法</li><li>你了解哪些设计模式</li><li>手写尽可能多的单例模式，线程安全不安全都可以</li><li>懒汉volitile模式的单例模式一般在什么场景下使用</li><li>linux如何查看僵尸进程</li><li>如何杀死一个僵尸进程</li><li>有kill -9杀不掉的进程的情况吗</li><li>如何查看机器的负载情况linux，除了top还有别的指令吗</li><li>MySQL调试过哪些参数</li><li>使用Redis如何实现分布式锁</li><li>如何使用zookeeper实现一个分布式锁</li><li>Redis的zset底层是用什么数据结构实现的</li><li>选offer时考虑哪些因素</li><li>平时通过什么方式去了解一些新技术</li><li>读过哪些技术相关的书</li></ul>',16),p={href:"https://mp.weixin.qq.com/s?__biz=MzUxODAzNDg4NQ==&mid=2247526756&idx=1&sn=d252ec468de0f2a327937a7a27a09365&chksm=f98d2dcecefaa4d85c4990faae462e67ff4f514d64ad8cd482f34687b8ed20dbd2c4ac87414e#rd",target:"_blank",rel:"noopener noreferrer"};function h(u,f){const e=d("ExternalLinkIcon");return t(),c("div",null,[s,l("blockquote",null,[l("p",null,[i("参考链接："),l("a",p,[i("https://mp.weixin.qq.com/s?__biz=MzUxODAzNDg4NQ==&mid=2247526756&idx=1&sn=d252ec468de0f2a327937a7a27a09365&chksm=f98d2dcecefaa4d85c4990faae462e67ff4f514d64ad8cd482f34687b8ed20dbd2c4ac87414e#rd"),n(e)]),i("，来源：小林，整理：沉默王二")])])])}const _=a(r,[["render",h],["__file","yongcwyyesmembncl.html.vue"]]);export{_ as default};
